def bing_search_save(file_name, query):
    subscription_key = os.getenv('BING_SEARCH_KEY')
    base_url = 'https://api.bing.microsoft.com/v7.0/search'
    headers = {'Ocp-Apim-Subscription-Key': subscription_key}
    params = {'q': query, 'count': 50, 'offset': 0, 'freshness': 'Month'}
    file_path = './web_searches/' + file_name
    response = requests.get(base_url, headers=headers, params=params)
    response.raise_for_status()
    search_results = response.json()
    folder_path = '.' + os.path.dirname(file_path)
    if not os.path.exists(folder_path):
        try:
            os.makedirs(folder_path)
        except OSError as e:
            return f'Error creating directory: {str(e)}'
    with open(file_path, 'w', encoding='utf-8') as file:
        if 'webPages' in search_results:
            for result in search_results['webPages']['value']:
                file.write(f"- [{result['name']}]({result['url']})\n")
        else:
            print("'webPages' not in search results")
    return (
        f"Response saved to: {file_path}, {len(search_results['webPages']['value'])} results found. Content: {search_results['webPages']['value']}"
        )

def create_code_search_csv(folder_name):
    root_folder = os.path.join(os.getcwd(), folder_name)
    if not os.path.exists(root_folder):
        os.makedirs(root_folder)
    code_search_file = os.path.join(root_folder, 'code_search.csv')
    with open('.gitignore', 'r') as f:
        gitignore = f.read()
    gitignore_spec = pathspec.PathSpec.from_lines(pathspec.patterns.
        GitWildMatchPattern, gitignore.splitlines())
    if os.path.exists(code_search_file):
        df = pd.read_csv(code_search_file)
        df['code_embedding'] = df['code_embedding'].apply(lambda x: ast.
            literal_eval(x) if isinstance(x, str) else x)
    else:
        code_files = []
        for root, dirs, files in os.walk(folder_name):
            for file in files:
                if file.endswith('.py'):
                    file_path = os.path.join(root, file)
                    if not gitignore_spec.match_file(file_path):
                        code_files.append(file_path)
        print('Total number of py files:', len(code_files))
        if len(code_files) == 0:
            print('No files detected.')
        all_funcs = []
        for code_file in code_files:
            funcs = list(get_functions(code_file))
            for func in funcs:
                all_funcs.append(func)
        print('Total number of functions extracted:', len(all_funcs))
        df = pd.DataFrame(all_funcs)
        if df.empty:
            print('Warning: No functions found in the code files.')
        else:
            df['code_embedding'] = df['code'].apply(lambda x: get_embedding
                (x, engine='text-embedding-ada-002'))
            df['filepath'] = df['filepath'].apply(lambda x: x.replace(
                folder_name, ''))
            df.to_csv(code_search_file, index=False)
            print('Code Search Online.')
    return df

def get_functions(filepath):
    with open(filepath, 'rb') as f:
        file_content = f.read()
        result = chardet.detect(file_content)
    encoding = result['encoding'] or 'utf-8'
    whole_code = file_content.decode(encoding, errors='ignore').replace('\r',
        '\n')
    try:
        tree = ast.parse(whole_code)
    except SyntaxError:
        return
    for node in ast.walk(tree):
        if isinstance(node, (ast.FunctionDef, ast.AsyncFunctionDef)):
            function_name = node.name
            code = astor.to_source(node)
            yield {'code': code, 'function_name': function_name, 'filepath':
                filepath}

